    // margin: '10px 0 5px 0',
    fontFamily: 'Arial, Helvetica, sans-serif',
    fontSize: '20px',
    backgroundColor:"green",
    borderRadius : "8px",
    padding:"25px"
};

const inputStyle = {
    margin: '15px 0px 30px 0',
    padding: '5px', 
    border: '1px solid #bfbfbf',
    borderRadius: '8px',
    boxSizing: 'border-box',
    width: '100%',
    height:  "50px",
    fontSize :"18px"
};

const submitStyle = {
    margin: '20px 0 0 0',
    padding: '7px 10px',
    borderRadius: '8px',
    background: 'linear-gradient(-45deg, #3db3c5, #274685)',
    width: '60%', 
    fontSize: '20px',
    color: 'white',
    display: 'block',
    height : "50px",
    cursor:"pointer"

};

class Success extends React.Component {



    render() {
        return (
            <form style={formStyle}  >
                <div>

                    {/* <div> */}
                            <label style={labelStyle} >{"Successfully Registered!"}</label>

                        {/* </div> */}

                   { <nav>
                        <Link to={"login"} style={{ display: 'flex', alignItems: "center", justifyContent: "center" , textDecoration:"none" }}>
                        <label style={labelStyle} >{"Successfully Registered!"}</label>
                        </Link>
                    </nav>}
                </div>
            </form>
        )
    }
}

export default Success
